export default [
  {
    start: "00.00",
    stop: "04.85",
    notation: "X:1\nM:4/4\nL:1/8\nK:perc\n|:cccc cccc|"
  },
  {
    start: "05.00",
    stop: "09.90",
    notation: "X:1\nM:4/4\nL:1/8\nK:perc\n|:cc cc/c/ cccc|"
  },
  {
    start: "10.10",
    stop: "15.10",
    notation: "X:1\nM:4/4\nL:1/8\nK:perc\n|:c/c c c c/ cc c/c/c/c/|"
  },
  {
    start: "15.30",
    stop: "20.30",
    notation: "X:1\nM:4/4\nL:1/8\nK:perc\n|:  c c c c c c/c c/|"
  }
];

/* 
We are shuffling the order of the notation images
Should we add an incorrect notation to each object?
Ideally, the incorrect would be random
SO, we want to pull a notation from an object in the array
that is NOT the current object
*/

